INSERT INTO `server_incident` (`id`, `title`, `description`, `jobId`, `factionId`, `playerLevel`, `amount`, `minutes`) VALUES
(1, 'Ernteknappheit', 'Bei der letzten Ernte konnte kein zufriedenstellender Ertrag geerntet werden, Damit die Bürgerinnen und Bürger von San Andreas keine Hungersnot erleiden müssen, sollten 100 Kg Weizen geerntet werden. Nutze den Job Landwirt, um dich an der Ernte zu beteiligen und beim Abschluss einen Bonus zu erhalten.', 7, 0, 1, 100, 120),
(3, 'Ausfall', 'Aufgrund eines technischen Defekts sind diverse Geräte in San Andreas ausgefallen. Alle Elektriker werden gebeten schnellstmöglich die defekten Anlagen zu reparieren.', 11, 0, 1, 25, 60),
(4, 'keine pizza mehr', 'wegen der ernteknappheit gibt auch keine pizza mehr zum ausliefern', 2, 0, 3, 10, 60),
(5, 'Test', 'Liefere Geld aus!', 10, 0, 1, 50, 60);
